import React from "react";
import Card from "./Card";

function createCard(emojipedia){
  return(
    <Card 
    emoji={emojipedia.emoji}
    />
  )
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <Card/>
    </div>
  );
}

export default App;
